import React from "react";

const StartBox = (props) => {
    return (
        <div className="col-lg-4 col-md-3 col-sm-3 d-flex align-items-center justify-content-center">
          <input type="button"
          className="startInput form-control"
          value="Empezar">
          </input>
        </div>
    )
}

export default StartBox;
